import React from 'react';
import s from './Card.module.css'

export const Card = ({data}) => {
    return(
        <div className={s.wrapper}>
            <div className={s.imgWrap}>
                <img src={data.image} alt="" />
            </div>
            <div className={s.content}>
                <h1 >{data.name}</h1>
            </div>
        </div>
    )
}
